import React from "react";
import styled from "styled-components";
styled;
const NavbarStyled = styled.div`
  width: 100%;
  height: 60px;
  box-shadow: 0 1px 3px rgba(15, 15, 15, 0.13);
  display: flex;
  align-items: center;
  padding: 0 1.5em;
`;

const Navbar = () => {
  return <NavbarStyled></NavbarStyled>;
};

export default Navbar;
